import React,{useState,useEffect,Fragment} from 'react';
import './css/App.css';
import uuid from 'react-uuid';


const App = () =>{
  const [books,setBooks] = useState([]);
  /*Fetch data with useEffect hook*/
  useEffect( () =>{
    fetch('./bookList.json')
    .then( data => data.json())
    .then( data => {
      data.map( book => book.bookId = uuid());
      setBooks(data);
    });
  },[]);
